window.bookSummaryJSON = "<p><b>For fans of </b><b><i>Little White Lies</i></b><b> and </b><b><i>Two Can Keep a Secret</i></b><b> comes an addictive thriller about a budding teen celebrity secretly investigating his brother's suspicious death while navigating the highs and lows of fame.</b></p> <p>Rising star Abel Miller has just landed a role in one of the hottest reboots on the Omni Channel, <i>Sunset High</i>. It looks like he’ll be yet another budding celebrity plucked from obscurity, but he has a secret: his brother, Adam, a mere production associate, died during the filming of the last attempt at <i>Sunset High</i>, and no one knows how... or why. Abel is going to find out.</p> <p>But when he meets the other stars of the show—Lucky, Ryan, and Ella, along with creator Lake Carte—he realizes there’s even more darkness beneath the shimmer of fame. They all have their own secrets to hide, and one of them is willing to kill to keep it that way.</p>"; 
